var tarotKeys = Object.keys(window.tarot.tarotData);


/****************************
    Helper Data Structures
*****************************/

// Maps index of cards to the file name
// Example usage: window.tarot.indexToCard[0] -> "0Fool.png"
window.tarot.indexToCard = function() {
    var arr = [];
    for (let i = 0; i < tarotKeys.length; i++) {
        arr.push(window.tarot.tarotData[tarotKeys[i]]);
    }
    return arr;
}();

// Maps name of card to the file name
// Example usage: window.tarot.nameToCard("Two of Wands") -> "wand2.png"
window.tarot.nameToCard = function() {
    var mappy = {};
    for (let i = 0; i < tarotKeys.length; i++) {
        var data = window.tarot.tarotData[tarotKeys[i]];
        mappy[data.name] = data;
    }
    return mappy;
}();


/****************************
        Helper methods
*****************************/

// Add randomInt to Math library
Math.randomInt = function(min, max) {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min)) + min;
};

/*
    Returns the filename key of a random card.
    Example usage:
        tarot.getRandomCard() -> "0Fool.png"
*/
window.tarot.getRandomCard = function() {
    var index = Math.randomInt(0, tarotKeys.length-1);
    return window.tarot.indexToCard[index];
}

/*
    The following methods create an image block for the specified card filename and output the resulting image block for the call.

    Examples:

    tarot.getImageBlock("0Fool.png") 
        -> <img src="data:image/png;base64,..." />

    tarot.getImageBlockWithStyle("0Fool.png", {"width": "34px", "height": "58px"})
        -> <img style="width:34px;height:58px" src="data:image/png;base64,..." />

    tarot.getImageBlockWithClass("0Fool.png", "cardClass")
        -> <img class="cardClass" src="data:image/png;base64,..." />

    tarot.getImageBlockWithId("0Fool.png", "cardId")
        -> <img id="cardId" src="data:image/png;base64,..." />

    tarot.getImageBlockWithClassAndId("0Fool.png", "cardClass", "cardId")
        -> <img class="cardClass" id="cardId" src="data:image/png;base64,..." />

    tarot.getImageBlockWithStyleClassAndId(
        "0Fool.png", {"width": "34px", "height": "58px"}, "cardClass", "cardId"
    )
        -> <img style="width:34px;height:58px" class="cardClass" id="cardId" src="data:image/png;base64,..." />
*/
window.tarot.getImageBlock = function(card) {
    return window.tarot.getImageBlockWithStyleClassAndId(card);
}

window.tarot.getImageBlockWithStyle = function(card, style) {
    return window.tarot.getImageBlockWithStyleClassAndId(card, style);
}

window.tarot.getImageBlockWithClass = function(card, cls) {
    return window.tarot.getImageBlockWithStyleClassAndId(card, undefined, cls);
}

window.tarot.getImageBlockWithId = function(card, id) {
    return window.tarot.getImageBlockWithStyleClassAndId(card, undefined, undefined, id);
}

window.tarot.getImageBlockWithClassAndId = function(card, cls, id) {
    return window.tarot.getImageBlockWithStyleClassAndId(card, undefined, cls, id);
}

window.tarot.getImageBlockWithStyleClassAndId = function(card, style = {}, cls = '', id = '') {
    // Accepts selection criteria in the following order:
    // 1. Filename
    // 2. Card name
    // 3. Index of entry in tarotData
    let cardData = window.tarot.tarotData[card] || window.tarot.nameToCard[card] || window.tarot.tarotData[Object.keys(window.tarot.tarotData)[card]];

    // Prep block data
    let img = $("<img>");
    img.css(style);
    if (cls) {
        img.addClass(cls);
    }
    if (id) {
        img.prop("id", id);
    }

    img.prop("src", "data:image/png;base64," + cardData.data);
    return img.prop('outerHTML');
}

// Style helpers

window.tarot.createStyleMap = function(sizeMultiplier, sizeXMultiplier = 1, sizeYMultiplier = 1) {
    return {
        "width": 34 * sizeMultiplier * sizeXMultiplier + "px",
        "height": 58 * sizeMultiplier * sizeYMultiplier + "px"
    };
}

